choices.text:
parser.parseArray(componentType, array, fieldName);

if (componentClass == byte.class) {
    byte[] bytes = new byte[array.size()];
    for (int i = 0; i < array.size(); ++i) {
        Object obj = array.get(i);
        if (obj == null) {
            bytes[i] = 0;
        } else {
            bytes[i] = TypeUtils.castToByte(obj);
        }
    }
    return (T) bytes;
}

parser.parseArray(componentType, array, fieldName);

if (lexer.token() == JSONToken.COMMA) {
    lexer.nextToken();
}

parser.accept(JSONToken.LBRACKET);
for (int i = 0;; ++i) {
    Object item = parser.parseObject(componentType, i);
    if (item == null && lexer.token() == JSONToken.RBRACKET) {
        break;
    }
    array.add(item);
    if (lexer.token() == JSONToken.COMMA) {
        lexer.nextToken(JSONToken.LITERAL_STRING);
    } else {
        break;
    }
}
parser.accept(JSONToken.RBRACKET);

parser.parseArray(componentType, array, fieldName);
if (componentClass == byte.class) {
    return (T) array.toArray(new byte[array.size()]);
}

